export default {
  "title": "Pupilfirst Developers",
  "tagline": "Focus on your students.",
  "url": "https://developers.pupilfirst.com",
  "baseUrl": "/",
  "favicon": "https://school.sv.co/favicon.png",
  "organizationName": "pupilfirst",
  "projectName": "pupilfirst",
  "themeConfig": {
    "navbar": {
      "title": "Pupilfirst Developers",
      "logo": {
        "alt": "Pupilfirst Logo",
        "src": "https://school.sv.co/favicon.png"
      },
      "items": [
        {
          "to": "docs/",
          "activeBasePath": "docs",
          "label": "Docs",
          "position": "left"
        },
        {
          "href": "https://pupilfirst.com",
          "label": "Home",
          "position": "right"
        },
        {
          "href": "https://github.com/pupilfirst/pupilfirst",
          "label": "GitHub",
          "position": "right"
        }
      ],
      "hideOnScroll": false
    },
    "footer": {
      "style": "dark",
      "links": [
        {
          "title": "Docs",
          "items": [
            {
              "label": "Introduction",
              "to": "docs/"
            },
            {
              "label": "Development Setup",
              "to": "docs/development_setup/"
            }
          ]
        },
        {
          "title": "Community",
          "items": [
            {
              "label": "Discord",
              "href": "https://discord.gg/Sh67Tca"
            },
            {
              "label": "Twitter",
              "href": "https://twitter.com/pupilfirstlms"
            }
          ]
        },
        {
          "title": "More",
          "items": [
            {
              "label": "Blog",
              "to": "https://blog.pupilfirst.com/"
            },
            {
              "label": "GitHub",
              "href": "https://github.com/pupilfirst/pupilfirst"
            }
          ]
        }
      ],
      "copyright": "Copyright Â© 2022 Pupilfirst Pvt. Ltd. Built with Docusaurus."
    },
    "prism": {
      "additionalLanguages": [
        "ruby",
        "bash"
      ]
    },
    "colorMode": {
      "defaultMode": "light",
      "disableSwitch": false,
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "ðŸŒœ",
        "darkIconStyle": {},
        "lightIcon": "ðŸŒž",
        "lightIconStyle": {}
      }
    },
    "docs": {
      "versionPersistence": "localStorage"
    },
    "metadatas": [],
    "hideableSidebar": false
  },
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "sidebarPath": "/home/prashanth/Projects/pupilfirst/docs/developers/sidebars.js",
          "editUrl": "https://github.com/pupilfirst/pupilfirst/edit/master/docs/developers/"
        },
        "theme": {
          "customCss": "/home/prashanth/Projects/pupilfirst/docs/developers/src/css/custom.css"
        }
      }
    ]
  ],
  "baseUrlIssueBanner": true,
  "i18n": {
    "defaultLocale": "en",
    "locales": [
      "en"
    ],
    "localeConfigs": {}
  },
  "onBrokenLinks": "throw",
  "onBrokenMarkdownLinks": "warn",
  "onDuplicateRoutes": "warn",
  "customFields": {},
  "plugins": [],
  "themes": [],
  "titleDelimiter": "|",
  "noIndex": false
};
